import React from "react";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";
import IconButton from "@mui/material/IconButton";
import MenuIcon from "@mui/icons-material/Menu";
import { createTheme, ThemeProvider, styled } from "@mui/material/styles";
import { green } from "@mui/material/colors";
import { TextField } from "@mui/material";
import { Grid } from "@mui/material";
import CategoryListComponent from "./CategoryListComponent";
import MenuOptionComponent from "./MenuOptionComponent";
import firebase from "firebase/compat/app";
import "firebase/firestore";
import { initializeApp } from "firebase/app";
import { getFirestore } from "firebase/firestore";

function AddMenuComponent() {
  const [anchorEl, setAnchorEl] = React.useState(null);
  const [selectedIndex, setSelectedIndex] = React.useState(0);
  const open = Boolean(anchorEl);
  const handleClickListItem = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const theme = createTheme({
    palette: {
      primary: {
        main: green[200],
      },
      secondary: {
        main: green[500],
      },
    },

    components: {
      MuiCard: {
        styleOverrides: {
          root: { margin: 8, maxWidth: 345}
        },
      },
    },
  });

  function ButtonAppBar() {
    return (
      <ThemeProvider theme={theme}>
        <AppBar position="static">
          <Toolbar>
            {/* <IconButton
              size="large"
              edge="start"
              color="inherit"
              aria-label="menu"
              sx={{ mr: 2 }}>
              <MenuIcon />
            </IconButton> */}
            <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
              Menu
            </Typography>
            <Button color="inherit">Edit</Button>
            <Button color="inherit">Delete</Button>
          </Toolbar>
        </AppBar>
      </ThemeProvider>
    );
  }

  return (
    <>
        <ButtonAppBar></ButtonAppBar>

        {/* <Grid container rowSpacing={1} columnSpacing={{ xs: 1, sm: 2, md: 3 }}>
          <Grid item xs={1}>
            <Button variant="contained" style={{maxWidth: '100px', maxHeight: '40px', minWidth: '100px', minHeight: '40px', margin:'10px'}}>Add</Button>
          </Grid>
          <Grid item xs={1}>
            <Button variant="contained" style={{maxWidth: '100px', maxHeight: '40px', minWidth: '100px', minHeight: '40px', margin:'10px'}}>Edit</Button>
          </Grid>
        </Grid> */}

        <h1 style = {{ margin:'10px' }}>Add Menu Item</h1>
        <Grid container spacing={3}>
        <Grid item xs={8}>
          <TextField id="outlined-basic" label="Category" variant="outlined" 
          style={{maxWidth: '400px', maxHeight: '40px', minWidth: '400px', minHeight: '40px', margin:'10px'}}/>
        </Grid>
        <Grid item xs={8}>
          <TextField id="outlined-basic" label="Name" variant="outlined" 
          style={{maxWidth: '400px', maxHeight: '40px', minWidth: '400px', minHeight: '40px', margin:'10px'}}/>
        </Grid>
        <Grid item xs={8}>
        <TextField id="outlined-basic" label="Options" variant="outlined" 
        style={{maxWidth: '400px', maxHeight: '40px', minWidth: '400px', minHeight: '40px', margin:'10px'}}/>
      </Grid>
      <Grid item xs={8}>
          <TextField id="outlined-basic" label="Price" variant="outlined" 
          style={{maxWidth: '400px', maxHeight: '40px', minWidth: '400px', minHeight: '40px', margin:'10px'}}/>
      </Grid>
      <Grid item xs={8}>
        <TextField id="outlined-basic" label="Cost" variant="outlined" 
        style={{maxWidth: '400px', maxHeight: '40px', minWidth: '400px', minHeight: '40px', margin:'10px'}}/>
      </Grid>
      <Grid item xs={8}>
        <TextField id="outlined-basic" label="Amount" variant="outlined" 
        style={{maxWidth: '400px', maxHeight: '40px', minWidth: '400px', minHeight: '40px', margin:'10px'}}/>
      </Grid>
      <Grid item xs={8}>
        <Button variant="contained" style={{maxWidth: '190px', maxHeight: '40px', minWidth: '190px', minHeight: '40px', margin:'10px'}}>Save</Button>
        <Button variant="contained" style={{maxWidth: '190px', maxHeight: '40px', minWidth: '190px', minHeight: '40px', margin:'10px'}}>Reset</Button>
      </Grid>
    </Grid>
    </>
  );
}

export default AddMenuComponent;
